		html {
			scroll-behavior: smooth;
		}

		.desktop-p {
			display: block;
		}

		.tablet-p,
		.phone-p {
			display: none;
		}


		    @media (max-width: 768px) {
      .tablet-p {
        display: block;
      }

      .phone-p {
        display: none;
      }

      .desktop-p {
        display: none;
      }
    }

    @media (max-width: 425px) {
      .tablet-p {
        display: none;
      }

      .phone-p {
        display: block;
      }

      .desktop-p {
        display: none;
      }
    }

		/* 1. use ONE big svg file with images
	2. RASTERIZE the images before exporting the svgs with object>rasterize
	3. use/recreate foreign objects for the images (copying from the svg to the index file)
	4. remake everything for desktop, tablet and phone (boring stuff ;w;)
	5. make buttons using the #, for instance #gen-b - it looks like this: 
	<a href="#gif-click">
	<g id="gif-b"> 
		(these are located IN THE INDEX FILE but within the button groups. use a single white box behind text, which you make into a button)
	6. use scroll-margin-top to create a space between the clicked area and the top of the screen; The scroll-margin-top property specifies the distance between the snap position and the container. 
	7. create animations for the dolphins! maybe just the desktop version. animation examples below, using keyframes!
	*/

		@keyframes floating {
			from {
				transform: translateY(-15px);
			}

			to {
				transform: translateY(15px);
			}
		}

		/* .dolphin{ <-- for classes */
		/* #dolphin{ <-- for one single object, no copies of this object */
		.dolphin {
			animation: floating 3s alternate infinite ease-in-out;
		}

		.dolphin2 {
			animation: floating 2s alternate infinite ease-in-out;
		}


		.dolphin3 {
			animation: floating 4s alternate infinite ease-in-out;
		}


		/* use classes instead of id for multiple animations - class= */

		/* you can copy and do floating 1 and floating 2 - you can make 3 different types of animations with different timings */
	</style>
</head>
